import { createIcon } from "../icon/createIcon";

export const PlayIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="PlayIcon">
    <path d="m2 1 9 5-9 5V1zm.999 1.699v6.603l5.942-3.301L2.999 2.7z" />
  </svg>,
  "Play",
  "play"
);
